import React from "react";

export const LoginForm = ({ 
    username,
    setUsername,
    handleLogin, handlePasswordClick, handleUsernameClick }) => {
    return (
        <form /*onSubmit={handleSubmit}*/>

            <h1 class="thin space">Sign In</h1>

            <h2 class='thin gap'>to continue to Gmail</h2>

            <label class="space">
                <input 
                    type='text' 
                    /*value={username} 
                    onChange={(e) => setUsername(e.target.value)}*/ 
                    placeholder="Username..."
                    onClick={handleUsernameClick}
                    onFocus={handleUsernameClick}
                />
            </label>
    
            <label class="space">
                <input 
                type='text'
                placeholder="Password..."
                onClick={handlePasswordClick}
                onFocus={handlePasswordClick}
                />
            </label>
            
            <button class="space">LOGIN</button>


            <p class="space">Forgot Username?</p>
            <p class="space">Forgot Password?</p>
            <p class="last">Create account</p>
        </form>
  );
}
